import React from "react";

function handleEditProfileClick() {
  const popupEditProfile = document.querySelector(".popup_type_edit-profile");
  popupEditProfile.classList.add("popup_opened");
}

function handleEditAvatarClick() {
  const popupEditProfile = document.querySelector(".popup_type_update-avatar");
  popupEditProfile.classList.add("popup_opened");
}

function handleAddPlaceClick() {
  const popupEditProfile = document.querySelector(".popup_type_add-author");
  popupEditProfile.classList.add("popup_opened");
}

function Main() {
  // const [isOpenedPopup, setIsOpenedPopup] = React.useState(false);

  return (
    <>
      <div className="popup popup_type_edit-profile">
        <div className="popup__container">
          <form className="popup__form" name="profile">
            <h2 className="popup__title">Редактировать профиль</h2>
            <label className="popup__label">
              <input
                name="author"
                type="text"
                className="popup__input"
                placeholder="Имя автора"
                // minlength="2"
                // maxlength="40"
                // required
                // novalidate
              />
              <span className="popup__input-error popup__input-error_type_author"></span>
            </label>

            <label className="popup__label">
              <input
                name="job"
                type="text"
                className="popup__input"
                placeholder="Занятие автора"
                // minlength="2"
                // maxlength="200"
                // required
                // novalidate
              />
              <span className="popup__input-error popup__input-error_type_job"></span>
            </label>
            <button
              className="popup__button-submit popup__button-submit_type_save"
              type="submit"
            >
              Сохранить
            </button>
          </form>
          <button className="popup__button-close popup__button-close_type_edit-profile"></button>
        </div>
      </div>
      <main>
        <section className="profile">
          <div className="profile__section">
            <button
            className="profile__button-edit-avatar"
            type="button"
            onClick={() => {handleEditAvatarClick()}}
            >
              <img src="" alt="аватар" className="profile__avatar" />
            </button>
            <div className="profile__info">
              <div className="profile__author-block">
                <h2 className="profile__author">Oleg Klyuev</h2>
                <button
                  type="button"
                  className="profile__button-edit"
                  onClick={() => {
                    handleEditProfileClick();
                  }}
                ></button>
              </div>
              <p className="profile__job">Rider</p>
            </div>
          </div>
          <button 
          className="profile__add-button"
          type="button"
          onClick={() => {
            handleAddPlaceClick();
          }}
          ></button>
        </section>

        <section className="elements">
          <template id="elementTemplate">
            <article className="element">
              <button className="element__button-photo" type="button">
                <img className="element__photo" />
              </button>
              <div className="element__place">
                <h3 className="element__place-name"></h3>
                <button className="element__delete" type="button"></button>
                <div className="element__likes">
                  <button className="element__like" type="button"></button>
                  <p className="element__number-like">1</p>
                </div>
              </div>
            </article>
          </template>
        </section>
      </main>
    </>
  );
}

export default Main;
